import NavBar from "./Components/NavBar";

function App() {
  return (
    <div>
      <NavBar />
      <Router>
        <Switch>
          <Route path="/login">
            <li className="nav-link">Login</li>
          </Route>
          <Route path="/signup">
            <li className="nav-link">Login</li>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
